def delete_nodes(head, m, n):
    curr = head
    while curr:
        for _ in range(m - 1):
            if not curr:
                return head
            curr = curr.next
        if not curr:
            return head
        temp = curr.next
        for _ in range(n):
            if not temp:
                curr.next = None
                return head
            temp = temp.next
        curr.next = temp
        curr = temp
    return head
